svg.script:
var f1 = document.getElementById('frame1')
var f2 = document.getElementById('frame2')
var f3 = document.getElementById('frame3')
var f4 = document.getElementById('frame4')

var animate = function(now,time,end) {
  return function(){
    now();
    setTimeout(end,time);
  }
}

var ds = function(el,st){
  return function(){
    el.style.display = st;
  }
}
var playit = function() {

  animate(
    ds(f1,'block'),
    1000,
    animate(
      ds(f2,'block'),
      1000,
      animate(
        ds(f3,'block'),
        1000,
        animate(
          ds(f4,'block'),
          1000,
          function(){
            ds(f1,'none')();
            ds(f2,'none')();
            ds(f3,'none')();
            ds(f4,'none')();
            playit();
          }
        )
      )
    )
  )()
}
playit();
